/* Home media */Revised the word "compresses" to "combines" in the following statement:
"The Blu-ray edition compresses the content of the first two DVDs onto one"

"Compression" is a poor choice of words, suggesting the content was squeezed into the one disc (typically requiring some trade-off),when the fact is the BD format allows for high definition due to much larger capacity; that greater capacity thereby allowing all relevant content from 2 DVD's to be on 1 BD, and in HD no less!
